from secret import flag
from Crypto.Util.number import long_to_bytes as l2b, bytes_to_long as b2l
from Crypto.Util.number import *


l = len(flag)
flag1 = b2l(flag[:l//2])
flag2 = b2l(flag[l//2:])

a, b = getPrime(1024), getPrime(1024)
C = a * b

c1 = flag1 ^ a
c2 = pow(flag2, 2, b)

print('c1 ', c1)
print('c2 ', c2)
print('C  ', C )

